  false,\n\t\"url\": null,\n\t\"notes\": \"IKONOS imagery was purchased to support
  the Pacific Islands Geographic Information System (GIS) project and the National
  Ocean Service's (NOS) coral mapping activities. One-meter panchromatic and four-meter
  multispectral data were purchased for the Territory of Guam. A digital vector shoreline
  was manually digitized from the one-meter panchromatic imagery to provide accurate,
  up-to-date shoreline data for the region.\",\n\t\"license_title\": null,\n\t\"extras\":
